import React from "react";
import { Link, Navigate } from 'react-router-dom';
import './Nav.css'


const Nav = () => {
    return (
        <div className="main-nav">
            <Link className='links'
                to="/home"
            > Home
            </Link>

           <Link className="links">
            <Navigate to="/characters/page/1">

            </Navigate>
            Characters
           </Link>

            <Link className='links'
                to="/houses/page/1"
            > Houses
            </Link>

        </div>

    )
}

export default Nav;
